import React, { Component } from 'react';

import './styles.css';

export default class Secao extends Component {

	render() {

		return (
			<section>
				<div class="container">
					<img src="img/resumo-sobre.jpg" class="grid-10 border_img" alt="Ilustração Sessão Sobre"></img>
					<h3>Sobre mim</h3>
					<p class="grid-5">Criei esse site como forma de mostrar meu trabalho.  Procuro um estágio como Desenvolvedor Front-End.</p>
				</div>
				<div class="div_resumo_btn">
					<a href="sobre.html" class="resumo_btn">Sobre mim</a>			
				</div>
			</section>
		);
	}

}
